  [],\n\t\"revision_timestamp\": \"2015-05-07T00:48:05.006633\",\n\t\"name\": \"predicting-hall-thruster-operational-lifetime-using-a-kinetic-plasma-model-and-a-molecular\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Hall thrusters are being considered for
  many space missions because their high specific impulse delivers a larger payload
  mass fraction than chemical rockets. With a low thrust, however, Hall thrusters
  need to operate for a long period of time to achieve the necessary velocity of the
  mission. For these missions, the lifetime requirements can reach into tens of thousands
  of hours. For Hall thrusters, the most important life-limiting process is the erosion
  of the channel walls. However, experimental verification of lifetime is time-consuming
  and expensive. Therefore, computational method is a useful tool to predict thruster
  lifetime. Many of the Hall thruster lifetime models were developed, and some of
  theses models gave quite promising results. However, while qualitatively interesting,
  the results did not match well with experiment. The reason of this discrepancy is
  that these numerical models assume electrons as a fluid. The proposed innovation
  will provide a better understanding of the erosion physics and will be useful for
  future Hall thruster development, such as HiVHAc, with low cost and time. This tool
  also will allow to aid in the acceptance and implementation of Hall thrusters as
  a primary propulsion device through improving confidence of their long term reliability.\",\n\t\"license_title\":
